  setTableOption = (event) => {
    const target = event.target
    const value = target.type === 'checkbox' ? target.checked : target.value
    const name = target.name
    this.setState({
      tableOptions: {
        ...this.state.tableOptions,
        [name]: value
      }
    })
  }



  filterShop = (state, instance) => {
    this.setState({loading: true})
    console.log(state.page)
    //console.log(instance);
    //this.props.shopShowAll('MK2')

    axios.get('http://192.168.4.161/laravel_study/public/shop/show', {
      page: state.page,
      pageSize: state.pageSize,
      sorted: state.sorted,
      filtered: state.filtered
    })
      .then((res) => {
        // Update react-table

        let rowsA =  res.data.slice(state.pageSize * state.page, (state.pageSize * state.page) + state.pageSize)
        let pagesA = Math.ceil(res.data.length / state.pageSize)
        console.log()
        this.setState({
          data: rowsA,
          pages: pagesA,
          loading: false
        })
      }).catch((e) => 
        {
            console.log("filterShopErr :" +e);
            this.setState({
              loading: false,
              noDataText:'Connection Error !',
            })
    });
  }

